CREATE TABLE vehicle_mileage (
    vehicle_id INT PRIMARY KEY,
    mileage INT,
    last_maintenance_date DATE
);

CREATE TABLE maintenance_schedule (
    schedule_id INT PRIMARY KEY,
    vehicle_id INT,
    maintenance_type VARCHAR,
    schedule_date DATE
);

CREATE TABLE replacement_parts (
    part_id INT PRIMARY KEY,
    part_name VARCHAR,
    vehicle_id INT,
    quantity INT
);

CREATE TABLE Vehicle (
   vehicle_id SERIAL PRIMARY KEY,
   vehicle_name VARCHAR(50) NOT NULL,
   model_year INTEGER,
   mileage INTEGER
);

CREATE TABLE ReplacementParts (
   part_id SERIAL PRIMARY KEY,
   part_name VARCHAR(50) NOT NULL,
   part_type VARCHAR(50),
   part_cost DECIMAL(10, 2)
);

CREATE TABLE MileageLog (
   log_id SERIAL PRIMARY KEY,
   vehicle_id INTEGER REFERENCES Vehicle(vehicle_id),
   log_date DATE,
   miles_driven INTEGER
);

CREATE TABLE MaintenanceSchedule (
   schedule_id SERIAL PRIMARY KEY,
   vehicle_id INTEGER REFERENCES Vehicle(vehicle_id),
   next_maintenance_date DATE,
   maintenance_type VARCHAR(50)
);
